586.source:
function replaceJoin(fromMorph, toMorph) {
    // alertOK("replace join " + fromMorph + " to "+ toMorph);
    this.getControlPoints().forEach(function(ea) {
        if (ea.connectedMagnet && ea.connectedMagnet.morph === fromMorph) {
            ea.setConnectedMagnet(toMorph.getMagnets()[0]);
        }
    });

}

590.source:
function getOppositeMorph(morph) {
    var p1 = this.controlPoints[0].connectedMagnet.morph;
    var p2 = this.controlPoints[1].connectedMagnet.morph;
    if (p1 === morph)
        return p2
    else
        return p1;
}

653.source:
function reset() {
    this.magnets = []
