681.source:
function onClick(evt) {
    if (evt.isCtrlDown())
        this.isFixed = ! this.isFixed;   

    if (this.isFixed) {
        this.setFill(Color.blue)    
    } else {
        this.setFill(Color.orange)            
    }
    evt.stop()
    return true
}

685.source:
function onDragStart(evt) {
    if (evt.isRightMouseButtonDown()) {
        this.line = this.get('Parts').get('Force').duplicate();
        this.line.setPosition(this.getPosition())
        this.line.setVertices([pt(0,0),pt(0,0)])


        this.get('Simulation').addMorphBack(this.line);

        var cp1 = this.line.getControlPoints().first();
        cp1.setConnectedMagnet(this.getMagnets()[0]);

        var other = this.get('Parts').get('Join').duplicate();
        this.get('Simulation').addMorphBack(other);
        other.setPosition(this.getPosition())

        var cp2 = this.line.getControlPoints().last();
        cp2.setConnectedMagnet(other.getMagnets()[0]);
        other.align(pt(0,0), other.localize(evt.mousePoint))
        other.openInHand()   
    } else {
        this.align(pt(0,0), this.localize(evt.mousePoint))
        this.openInHand();
    }
}

