9378.source:
function simulateJoin(morph) {
    var forces = this.getForcesOfMorph(morph)

    // sum up spring forces
    var f = pt(0,0);
    forces.forEach(function(c) {
        var other = c.getOppositeMorph(morph);
        var dR = c.getOriginalLength() - c.getLength();
        if (dR < 0) {
         dR = dR * dR * -0.001;
         c.setBorderColor(Color.red)
        } else {
         dR = dR * dR * 0.001;
         c.setBorderColor(Color.green)
        }
        var d = morph.bounds().center().subPt(other.bounds().center())
        d = d.normalized()
        f = f.addPt(d.scaleBy(dR *  this.forceFactor))
    }, this)

    // add g force
    f = f.addPt(pt(0, this.gForce))
    morph.velocity = pt(0,0) || morph.velocity;
    morph.velocity = morph.velocity.addPt(f)

    morph.moveBy(morph.velocity)
    this.keepJoinInBounds(morph)
}

9390.source:
function getForcesOfMorph(morph) {
    var forces = [];
    morph.getMagnets().forEach(function(eaMagnet) {
        eaMagnet.connectedControlPoints.forEach(function(ea) {
            if (ea.morph && ea.morph.owner) {
                forces.push(ea.morph)
            }
        })
    })
    return forces
}

